script: |
  super -f text -I q5888.spq | sort > q5888.out

inputs:
  - name: q5888.spq
    data: |
      SELECT DISTINCT ( col1 ) * + col1 + col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT col2 BETWEEN + col1 AND NULL AND NOT - 97 IN ( + - col1 / + - col0 );
  - name: tab2

outputs:
  - name: q5888.out
    data: |
      2652
      4556
      6006
